import{_ as e,o as t,c as o,a as i}from"./app.57a3dbd1.js";const f=JSON.parse('{"title":"Notify robot","description":"","frontmatter":{"contributors":["ZhouYixun","upengfei","ayumi760405","stephenwang1011"]},"headers":[{"level":2,"title":"DingTalk group robots","slug":"dingtalk-group-robots","link":"#dingtalk-group-robots","children":[]},{"level":2,"title":"Feishu group robot","slug":"feishu-group-robot","link":"#feishu-group-robot","children":[]},{"level":2,"title":"Enterprise WeChat Robot","slug":"enterprise-wechat-robot","link":"#enterprise-wechat-robot","children":[]},{"level":2,"title":"Friends Space Robot","slug":"friends-space-robot","link":"#friends-space-robot","children":[]},{"level":2,"title":"Telegram Bot","slug":"telegram-bot","link":"#telegram-bot","children":[]},{"level":2,"title":"LINE Notify","slug":"line-notify","link":"#line-notify","children":[]},{"level":2,"title":"Slack Bot","slug":"slack-bot","link":"#slack-bot","children":[]}],"relativePath":"en/doc/doc-robot.md","lastUpdated":1716537034000}'),l={name:"en/doc/doc-robot.md"},a=i('<h1 id="notify-robot" tabindex="-1">Notify robot <a class="header-anchor" href="#notify-robot" aria-hidden="true">#</a></h1><p>Introduces the access methods of various types of robots.</p><h2 id="dingtalk-group-robots" tabindex="-1">DingTalk group robots <a class="header-anchor" href="#dingtalk-group-robots" aria-hidden="true">#</a></h2><ol><li>Select the group chat where the robot needs to be sent, and click [Group Settings] on the upper right.</li><li>Click [Intelligent Group Assistant].</li><li>Click [Add Robot].</li><li>Select [Custom] robot.</li><li>(Optional) Click [Add Signature] in the security settings, and the [Robot Key] of the Sonic platform appears below, copy the key and fill it in the project.</li><li>Click the [Finish] button, and the robot will be added. The WebHook that appears at this time is the [Robot Hook] of the Sonic platform. Copy the WebHook and fill it in the project.</li><li>Done! The platform can push the message.</li></ol><h2 id="feishu-group-robot" tabindex="-1">Feishu group robot <a class="header-anchor" href="#feishu-group-robot" aria-hidden="true">#</a></h2><ol><li>Select the group chat where the robot needs to be sent, and click [Settings].</li><li>Click [Group Robots].</li><li>Click [Add Robot].</li><li>Select 【Custom Robot】.</li><li>(Optional) Click [Signature Verification] in the security settings, and the [Robot Key] of the Sonic platform will appear, copy the key and fill it in the project.</li><li>Click the [Finish] button, and the robot will be added. The WebHook that appears at this time is the [Robot Hook] of the Sonic platform. Copy the WebHook and fill it in the project.</li><li>Done! The platform can push the message.</li></ol><h2 id="enterprise-wechat-robot" tabindex="-1">Enterprise WeChat Robot <a class="header-anchor" href="#enterprise-wechat-robot" aria-hidden="true">#</a></h2><ol><li>Select the group chat where the robot needs to be sent, and click [Settings].</li><li>Click [Add Robot].</li><li>Click 【Create a new robot】.</li><li>Click the [Finish] button, and the robot will be added. The WebHook that appears at this time is the [Robot Hook] of the Sonic platform. Copy the WebHook and fill it in the project.</li><li>Done! The platform can push the message.</li></ol><h2 id="friends-space-robot" tabindex="-1">Friends Space Robot <a class="header-anchor" href="#friends-space-robot" aria-hidden="true">#</a></h2><ol><li>Select the group to send the robot to, enter the group, and click [Settings]</li><li>Click [Group Robots].</li><li>Click [Add Robot] -&gt; [Custom Robot] (you can also select an existing robot).</li><li>Click the [Add] button, and the robot is added. The webHook that appears at this time is the [Robot Hook] of the Sonic platform. Copy the webHook and fill it in the project.</li><li>Done! The platform can push the message.</li></ol><h2 id="telegram-bot" tabindex="-1">Telegram Bot <a class="header-anchor" href="#telegram-bot" aria-hidden="true">#</a></h2><ol><li>Create a Telegram bot through <a href="https://t.me/BotFather" target="_blank" rel="noreferrer">@BotFather</a> in Telegram and obtain a bot token.</li><li>Add the robot to the specified chat or chat group in Telegram.</li><li>Use <code>https://api.telegram.org/bot{Token}/getUpdates</code> link to get chatId</li><li>Replace the Token and chatId of the following link <code>https://api.telegram.org/bot{Token}/sendMessage?chat_id={chatId}</code> to form a webHook.</li><li>The formed webHook is the [Robot Hook] of the Sonic platform, copy the webHook and fill it in the project.</li><li>Done! The platform can push the message.</li><li><a href="https://core.telegram.org/bots/api" target="_blank" rel="noreferrer">Telegram Bot API Reference Link</a></li></ol><h2 id="line-notify" tabindex="-1">LINE Notify <a class="header-anchor" href="#line-notify" aria-hidden="true">#</a></h2><ol><li>Log in to <a href="https://notify-bot.line.me/doc/en/" target="_blank" rel="noreferrer">Line Notify</a> and enter the personal page.</li><li>Click [Issue Token] and set the name and select the group to receive notifications.</li><li>Press Release to get 【Token】.</li><li>The obtained Token is the [Robot Hook] of the Sonic platform, copy the Token and fill it in the project.</li><li>Done! The platform can push the message.</li><li><a href="https://notify-bot.line.me/doc/en/" target="_blank" rel="noreferrer">Line Notify API reference link</a></li></ol><h2 id="slack-bot" tabindex="-1">Slack Bot <a class="header-anchor" href="#slack-bot" aria-hidden="true">#</a></h2><ol><li>Log in to <a href="https://api.slack.com/apps" target="_blank" rel="noreferrer">Slack App</a>, and click the &quot;Create New App&quot; button to create an App.</li><li>In the App details, click &quot;Features&quot; -&gt; &quot;Incoming Webhooks&quot; -&gt; &quot;Activate Incoming Webhooks&quot;.</li><li>Then click the &quot;Add New Webhook to Workspace&quot; button, and then select the person or channel you want to send.</li><li>Go back to the APP details interface and copy the Webhook URL just generated.</li><li>Enter the Sonici platform, select Slack Bot on the message push setting page, and fill in the URL just copied for Webhook.</li></ol>',16),r=[a];function n(h,s,c,d,p,b){return t(),o("div",null,r)}const g=e(l,[["render",n]]);export{f as __pageData,g as default};
